#!/usr/bin/env python3

def partition(item, first, last) -> int:
  pos   = first

  for i in range(first, last):
    if item[i] < item[last]:
      item[i], item[pos] = item[pos], item[i]
      pos += 1
  item[pos], item[last] = item[last], item[pos]
  return pos

def qsort(item, first, last):
  if first < last:
    pos   = partition(item, first, last)
    qsort(item, first, pos - 1)
    qsort(item, pos + 1, last)

def quickSort(item : list) -> list:
  qsort(item, 0, len(item) - 1)
  return item
